import React from 'react';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const Csr=()=>{
    return(
<>
        <Grid item xs={6} sm={3}>
          <Paper >xs=6 sm=3</Paper>
        </Grid>
        <Grid item xs={6} sm={3}>
          <Paper >xs=6 sm=3</Paper>
        </Grid>
</>
    );
}

export default Csr;
